DESCRIPTION:
The 800.1 EVO 5 is a compact, modern amplifier that delivers 800W RMS of power distributed over 1 channel.&lt;br&gt;
&lt;br&gt;
The amplifier features exclusive and patented technologies that make the sound experience cleaner and more faithful, in addition to ensuring better performance and efficiency for the most daring projects.

Enjoy your music from traditional CDs or listen to the FM radio. For playback of MP3, WMA and WAV audio files, you can easily hook up your iPod, iPhone, Android smartphone or a USB stick to the illuminated front USB or to the Aux-In.&lt;br&gt;
&lt;br&gt;
 &lt;br&gt;
&lt;br&gt;
For smartphone users, simply connect your iPhone or Android* smartphone and safely enjoy Spotify (both for Free and Premium Spotify users) or the Pioneer Advanced Remote Control (ARC) app, which will take your smartphone to a whole new level. (*Android smartphones require Android 5.0 or later, up to 7.1.2, and the smartphone requires AOA (Android Open Accessory) 2.0.)&lt;br&gt;
&lt;br&gt;
 &lt;br&gt;
&lt;br&gt;
Get pristine sound from the DEH-S220UI′s on-board MOSFET 50 W x 4 amplifier, or utilising the 2 RCA connectors to connect other components, like speakers, subwoofers, amplifiers, for even more versatility.&lt;br&gt;
&lt;br&gt;
 &lt;br&gt;
&lt;br&gt;
The attractive, 1-DIN design offers plenty of room to display useful information. It also has a large Rotary Commander and easy to access preset buttons to select your favourite radio stations.

The Z12000 monoblock subwoofer amplifier is the latest offering in the legendary Z series of top-of-the-line powerhouse amplifiers. This amplifier can deliver well above 12,000 watts of continuous, unbridled power. Engineered for performance, it incorporates state-of-the-art circuit optimization for a high-current, half-bridge amp with a surprisingly small footprint that allows for 2 wide installation in many of todays popular SPL/DEMO vehicles.&lt;br&gt;
&lt;br&gt;
The Z12’s chassis features DD Audio’s exclusive High Volume Air Circulation (HVAC) heat management system. The mass of the heavy-duty extruded aluminum heatsink coupled with intelligent fin design constantly transfers heat to the outside air while an internal brushless fan pulls in cooler air through an elevated bottom panel and end panel vents to maximize air flow over hard working internal components.&lt;br&gt;
&lt;br&gt;
Its also ready to connect to the DD Audio ZVL module, giving it the flexibility to easily integrate into multi amp systems to drive the most punishing of subwoofer stages.
